おふろの洗剤 泡タイプ(さわやかシトラスの香り) つめかえ用 350ml<br>ブランド：ロケット石鹸<br>販売・製造元：ロケット石鹸<br><br>泡タイプのおふろ用洗剤です。<br>●泡が浴槽の汚れをつつみこみ、すばやく分解してこすらず落とします。<br>●床や壁のしつこい汚れも軽くこするだけです。<br>●すばやい水切れで壁の防カビ効果があります。<br> <br>用途浴槽(ポリ・ホーロー・ステンレス)、浴室の床・壁、洗面器、イス、洗面台 使用量の目安1平方メートルに対して約9回噴射 <br><br>使用上の注意<br>●用途以外に使わない。<br>●幼児の手の届くところに置かない。<br>●荒れ性の方や長時間使う場合、炊事用手袋を使う。<br>●大理石の浴槽には使用しない。<br>●塗装面は目立たない場所で確かめてから使う。<br>●必ず単独で使用する。<br>●窓を開けるなど、換気を良くして使う。<br>換気扇がある場合は併用する。<br>●シミになることがあるので長時間放置しない。<br>●除菌した場合は、除菌したい部分に原液をかけた後5分以上放置し、すすぎ流す。<br>※すべての菌を除菌するわけではありません。<br> ご注意<br>●パックを持つと液が飛び出る場合があるので注意する。<br>●他の洗剤などと混ぜない。<br>●必ず、中性タイプの浴室用洗剤、またはきれいに洗浄したスプレー式ボトル(400ml)に詰め替える。<br>●あふれないように、液をほとんど使い切ってからつめかえる。<br>●つめかえ後のパックは小さく丸め、ゴミの減量化を。<br>捨てる際は、市町村の区分に従ってください。<br> 応急処置●目に入った時は、こすらずにただちに流水で15分以上洗い流し必ず眼科医に相談する。<br>●誤って飲み込んだときは、吐かずに口をすすぎ、水を飲む等の処置をする。<br>異常が残る場合は、医師に相談する。<br> <br>成分<br>界面活性剤(5% アルキルアミンオキシド)、泡調整剤、キレート剤<br> 原産国日本 <br><br>お問い合わせ先<br>TEL：0948-43-0756ロケット石鹸株式会社福岡県嘉麻市山野2091 <br>日用品／掃除用品／お風呂用 掃除用品／洗剤 おふろ用<br>JANコード： 4903367091901<br><br>CS：20<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
