しぜん派 アワアワットせんたく洗剤 つめかえ用 800ml<br>ブランド：ロケット石鹸<br>販売・製造元：ロケット石鹸<br><br>やさしい泡でしっかり洗う洗濯用洗剤です。<br>ニオイの原因となる汗・皮脂汚れをしっかり落とします。<br>生分解性に優れた活性剤を使用しており環境にも配慮。<br>蛍光増白剤が入っていないので、きなりや淡色衣料も安心です。<br>洗濯時の泡立ちが少ない為ドラム式にもお薦めです。<br> <br>用途綿・麻・合成繊維用 <br><br>使用方法<br>お洗濯の前に確認●衣料品の取扱い表示にしたがって洗濯する。<br>中性のマークがあるもの、水洗いができない衣料品には使わない。<br>●色落ちが心配な衣料は、目立たない部分に原液をつけて5分ほどおき、白い布に色移りしないかを確認。<br>落ちにくい汚れには、少量を直接塗布するといっそう効果的です。<br>また、がんこな汚れや、汚れのひどい物は「つけ置き洗い」が効果的です。<br>●使用量の目安              洗濯機の        大きさ               ドラム式        洗濯物量               一般タイプ        洗濯水量               使用量の        目安                    7.0kgから               6kg               65L               43ml                    4.2kgから               3kg               45L               30ml                    2.2kgから               2kg               30L               20ml                    手洗い               洗面器（5L)に        料理用小さじ1杯(約3ml)       <br><br>使用上の注意<br>●用途外に使わない。<br>●幼児の手の届く所に置かない。<br>●うすめた液を長時間おくと変質することがあるので、使用のつどうすめて使う。<br>●使用後は手をよく水で洗い、クリームなどでお手入れを。<br>●荒れ性の方や長時間使う場合、また洗剤をブラシにつけて洗う時は炊事用手袋を使う。<br>●洗たく機のフタなどのプラスチック部分に原液がついた時は水でふきとる。<br>放置すると傷むことがある。<br>●日の当たる場所など高温になる所に長時間置かない。<br> ご注意<br>●パックを強く持つと、液が飛び出ることがあるので注意する。<br>●他の洗剤などと混ぜない。<br>●お手持ちの衣料用液体洗剤またはきれいに洗浄したボトルにつめかえる。<br>●あふれないように、液をほとんど使い切ってからつめかえる。<br> 応急処置●目に入った時は、こすらずにただちに流水で15分以上洗い流し必ず眼科医に相談する。<br>●誤って飲み込んだ時は、吐かずに口をすすぎ、水を飲む等の処置をする。<br>異常が残る場合は、医師に相談する。<br> <br>成分<br>界面活性剤(18% ポリオキシエチレンアルキルエーテル)、安定化剤、アルカリ剤液性：弱アルカリ性<br> 原産国日本 <br><br>お問い合わせ先<br>ロケット石鹸株式会社0948-43-0756 <br>日用品／洗濯用品／洗濯洗剤／液体石鹸(衣類用)<br>JANコード： 4903367091376<br><br>CS：15<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
