オレンジフレッシュ オレンジオイル配合 詰替用 500ml<br>ブランド：フレッシュ<br>販売・製造元：ロケット石鹸<br><br>さわやかオレンジオイル配合の食器用洗剤です。<br>しつこい油汚れもスッキリ。<br>オレンジの香り。<br> <br>用途野菜・果物・食器・調理器具 <br><br>使用方法<br>●ボトルへの詰め替え方(1)・袋をたて、上部の切り口マークから点線にそって切ってください。<br>・パックを強く持つと、液が飛び出ることがあるので注意する。<br>(2)・他の洗剤などとまぜない。<br>・必ず、台所用洗剤のボトル(600ml)につめかえる。<br>・あふれないように、液をほとんど使い切ってからつめかえる。<br> 使用量の目安水1Lに対して1.5ml(調理用小さじ1杯は約5ml) <br><br>使用上の注意<br>●用途外に使わない。<br>●幼児の手の届く所に置かない。<br>●うすめた液を長時間おくと変質することがあるので、使用のつどうすめて使う。<br>●使用後は手をよく水で洗い、クリーム等でお手入れを。<br>●荒れ性の方や長時間使う場合、または原液をスポンジに含ませて使用するときは炊事用手袋を使う。<br>●野菜・果物を洗う時は5分以上つけたままにしない。<br>●流水の場合、食器及び調理用具は5秒以上、野菜・果物は30秒以上、ため水の場合は水をかえて2回以上すすぐ。<br> 応急処置●目に入ったときはこすらずすぐに流水で15分以上洗い流し、必ず眼科医に受診する。<br>●誤って飲みこんだときは、吐かずに口をすすぎ、水を飲む等の処置をする。<br>異常が残る場合は、医師に相談する。<br> <br>成分<br>界面活性剤(16% 直鎖アルキルベンゼンスルホン酸ナトリウム、ポリオキシエチレンアルキルエーテル)、安定化剤<br> 原産国日本 <br><br>お問い合わせ先<br>ロケット石鹸株式会社 TEL：0948-43-0756 <br>日用品／キッチン用品／台所用洗剤／洗剤 食器用<br>JANコード： 4903367090782<br><br>CS：20<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
