ソフィ ふわごこち 快適ロング 無香料 56枚入<br>ブランド：ソフィ<br>販売・製造元：ユニ・チャーム<br><br>下着だけより気持ちいいおりものシートです。<br>心地いい、ふわふわ素材の表面シートがクッションみたいに触れるから、肌にやさしいライナーです。<br>手で丸めてもほわーんと元通りになる弾力シートが下着にも体にも、やさしくなじみます。<br>全面通気性シートでムレを防ぎます。<br>無香料。<br> <br>おりものシート(パンティライナー)とはおりものによる下着の汚れを防ぐために、下着に装着するシートです。<br>パンティライナーともいいます。<br><br>日用品／生理用品／パンティーライナー／おりものシート(パンティライナー)<br>JANコード： 4903111352500<br><br>CS：18<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
