サラサーティ ランジェリー用洗剤 120ml<br>ブランド：サラサーティ<br>販売・製造元：小林製薬<br><br>血液やおりものの汚れをすっきり落とすランジェリー洗剤です。<br>つけおき20分程、ゴシゴシ洗う必要はありません。<br>使いやすいワンタッチキャップです。<br> <br><br><br>使用方法<br>●使用量の目安つけ置き洗いの場合は、水またはぬるま湯500mlに対し、約10ml(ボトル側面の1目盛：ボトルを逆さまにして計って下さい。<br>)洗濯機洗いの場合は、汚れの量にあわせて適量をご使用下さい。<br>●<br><br>使用方法<br>つけ置き洗いの場合は、上記の溶液に約20分つけ置き、その後よくすすいで下さい。<br>時間がたった汚れや落ちにくい汚れには、洗剤を直接塗布してもみ洗いの後、上記の溶液に長めにつけ置くと効果的です。<br>洗濯機洗いの場合は、洗剤を直接汚れにつけて軽くもみ洗いした後、通常通り洗濯機で洗って下さい。<br> 側面目盛りの使い方ボトルを逆さまにした状態でボトルを指で押し、液面が1目盛減れば10mlです。<br>水の量に合わせて使用量を計って下さい。<br> 商品概要●用途：綿、麻、ポリエステル、キュプラ、レーヨンその他合成繊維用●液性：弱アルカリ性●成分：界面活性剤(40%アルキルスルホン酸ナトリウム(SAS)、ポリオキシレンアルキルエーテル、アルキル硫酸エステルナトリウム)、安定化剤 <br><br>使用上の注意<br>・子供の手の届くところに置かない。<br>・用途以外に使用しない。<br>・絹、毛の製品には使用しない。<br>・皮膚の弱い方や長時間使用する場合、また原液で使用するときは炊事用などの手袋を使用する。<br>・使用後は手を水でよく洗い、クリームなどでの手入れをおすすめします。<br> 応急処置・目に入った場合、こすらず、すぐ流水で15分以上洗い流す。<br>・飲みこんだときは、吐かせず、すぐに口をすすぎ、コップ1-2杯の牛乳か水を飲ませる。<br>(いずれの場合も処置した上、異常のある場合は本品を持参し、医師に相談する。<br>) <br>日用品／洗濯用品／洗濯洗剤／ランジェリー洗剤<br>JANコード： 4987072066447<br><br>CS：48<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
