液体ブルーレットアロマ リラックスアロマの香り 無色の水 つけ替用<br>ブランド：ブルーレット<br>販売・製造元：小林製薬<br><br>バリ島でのアロマスパをイメージしたアロマ調フレグランスが香るトイレ用芳香剤です。<br>心地よいリラックスアロマの香りがトイレ空間に漂います。<br>洗浄・防汚成分を配合。<br>便器をコートし、汚れの付着を抑えます。<br>泡立ちながら、汚れを洗い流し、便器の輝きを保ちます。<br>流れる水は無色です。<br>標準的な使用で約1ヶ月間(3-5週間)使用できます。<br>(気温、水温、水量などにより、多少変化します。<br>)つけ替用。<br> <br>用途水洗トイレ用 <br><br>使用方法<br>※注意：ボトルについている止栓キャップを絶対にはずさないでください。<br>(1)タンクの上でひねりながらはずす。<br>(2)逆さまに持って突起部で止栓キャップを突き破ってセットする。<br>(注意)4本足の部分ではささない。<br>(3)脚部を差し込む。<br>※薬液がこぼれるおそれがありますので、ボトルの側面を強く押さないでください。<br>※へこみ部分が隠れるまでしっかり差し込まないと、薬液がこぼれて短期間でなくなる場合があります。<br>※容器に直接水があたらなくても使えます。<br>※構造上、ボトル内に水が入り、薬液が減っていないように見えることがありますが、薬液は必要量出ています。<br>またこの場合、終了直前に一気に薬液が無くなることがあります。<br>※タンクの種類や水流の強さによって、泡立ちが少ないことがありますが、薬液は必要量出ており、洗浄効果に問題ありません。<br>●薬液がなくなりましたら、専用の「液体ブルーレットおくだけアロマ・つけ替用」をお求めください。<br>「液体ブルーレットおくだけ」には使えますが、その他のブルーレット製品には使用できません。<br> <br><br>使用上の注意<br>●用途外には使用しない。<br>●小児の手の届くところに置かない。<br>●火気や、直射日光を避け、40度以上になるところに置かない。<br>●水の流れが強すぎたり水の量が多すぎると、水がはねたり、まれに容器が倒れ穴をふさぎ水があふれる場合がある。<br>その場合はタンク横の止水栓で水流を弱めるなど調節をする。<br>●使用中、本品を逆さま、横倒しにしない。<br>万一そうなった場合は、もとの位置に戻す。<br>●タンクの手洗い部分の排水口に網がある場合、手洗い部の水の流れが悪い場合、下容器が汚れてきた場合などは、水があふれるのを防ぐためにときどき網・下容器を清掃する ご注意<br>●使用できないトイレ※おしり洗浄機能つきトイレにも使用できますが、ごく一部、ご使用いただけないタイプ(トイレタンクの水をおしり洗浄に使うタイプ)があります。<br>※簡易水洗タイプ(汲み取り式)には使用できません。<br> 応急処置●目に入った場合は、こすらずすぐ流水で充分に洗い流す。<br>●飲み込んだ場合は、コップ1-2杯の水を飲む。<br>●皮ふについた場合は、水で充分に洗い流す。<br>いずれの場合も処置の後、異常のある場合はこの説明書きを持参し、医師に相談する。<br> <br>成分<br>香料、非イオン界面活性剤、両性界面活性剤<br> 原産国日本 <br><br>お問い合わせ先<br>小林製薬株式会社お客様相談室：06-6203-3673受付時間9：00-17：00(土・日・祝日を除く) <br>日用品／家庭用品／消臭・芳香剤／芳香剤 トイレ用<br>JANコード： 4987072025758<br><br>CS：48<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
